import React, { useState } from "react";

function CounterFunction() {
  let [number, setNumber] = useState(0);

  function increment() {
    setNumber(number + 1);
  }

  return (
    <div>
      <h1>Counter = {number} </h1>
      <button onClick={(e) => increment()}>Increment fun</button>
    </div>
  );
}

export default CounterFunction;
